import React from 'react';
import './Home.css'; // Import your CSS file for styling

// Import the image
import githubLogo from '/Users/adrianburke/Desktop/Full-StackProject-FrontEnd-/src/Tech_Space-removebg-preview.png';

function Home() {
  return (
    <div className="home">
      <div className="header">
        {/* GitHub logo and navigation */}
        <img
          className="github-logo"
          src={githubLogo} // Use the imported image as the source
          alt="GitHub Logo"
        />
        <nav className="nav-links">
          <ul>
            <li>Repositories</li>
            <li>Projects</li>
            <li>Explore</li>
            {/* Add more navigation links as needed */}
          </ul>
        </nav>
      </div>
      <div className="main-content">
        {/* Main content of your Home page */}
        {/* Add content cards, user information, and other elements */}
      </div>
    </div>
  );
}

export default Home;
